      return (
        <div className="DivSombra">
          {props.children}
          <style jsx>{`
          .DivSombra{
            width: 100%;
            font-size: 17px;
            font-family: sans-serif;

            color: #ffffff;

            background-color:#00ffea;
            background: rgba(0, 255, 255, 0.2);

            border: solid 2px #00ffea;
            border-radius: 4px;
            padding: 10px;        
          }
        `}</style>
        </div>
      )
    }

export default JanelaTerminal
